import Link from "next/link";

const Header = () => (
  <>
    <div className="navbar">
      <div className="wrapper">
        <Link href="/">
          <a className="navlink">Home</a>
        </Link>
        <Link href="/about">
          <a className="navlink">About</a>
        </Link>
      </div>
    </div>
    <style jsx>
      {`
        .navbar {
          border: 5px;
          width: 30px;
        }

        .wrapper {
          display: flex;
          flex-direction: column;
          justify-content: center;
          height: 100px;
          position: absolute;
          text-align: center;
          top: 50vh;
        }

        .navlink {
          color: #2699fb;
          font-family: "Arial";
          margin: 35px 0;
          text-decoration: none;
          transform: rotate(-90deg);
        }

        .navlink:hover {
          opacity: 0.6;
        }
      `}
    </style>
  </>
);

export default Header;
